body:
AMC no longer counts as a meme stock.  It's actually a decent investment now with no bankruptcy issues, having stronger-than-expected sales, and literally America is opening back up and everyone is going back to theaters.  I now hold AMC in my core portfolio now with stuff like APPL, TGT, and HD...  it's stupid to not have this stock in your portfolio at this point.

&amp;#x200B;

Also add more GME...
